import { mount } from '@vue/test-utils';
import Vue from 'vue'
declare global {
  interface Window {
    webkitSpeechRecognition:any;
  }
}
// Vue.extend をつけないとプロパティerrorが発生
  export default Vue.extend({
    data() {
      return {
        recognizing: false,
        recognition: new window.webkitSpeechRecognition(),
        recordBtnValue :"録音開始",
        recoredTexts: "",
        recoredMiniText: "",
        size_text: "" as string,

        text : "100",
        shellnum: 100,
        sizes:[] as number[],
        size_avg:21,
        move_shel:10,
        connum:2,
        boxes:2,
        deep:8.5,
        updata:"2023/07/05/18:27",

        Step1on: false,
        Step2on: false,
        Step3on: false,
        Step4on: false,
        DeleteItem: false,

        //textarea: <HTMLTextAreaElement>document.getElementById("textarea"),
      };
    },
    // watch : {
    //   recoredTexts(){
    //     let height = this.textarea.clientHeight;
    //     let scrollHeight = this.textarea.scrollHeight;

    //     this.textarea.scrollTop = scrollHeight - height;
    //   }
    // },
    methods: {
      async created() {
        this.recognition.lang = "ja-JP";
        this.recognition.continuous = true;
        this.recognition.onresult = await this.recognize;
      },
      autoScroll(){
        console.log("hello");
        let textarea= <HTMLTextAreaElement>document.getElementById("textarea");
        let scrollHeight = textarea.scrollHeight;
        let innerHeight = 104;
        console.log(scrollHeight + " " + innerHeight);
        if(scrollHeight > innerHeight){
          textarea.scrollTo(0, scrollHeight - innerHeight);
        }
      },
      // AutoScrolltextarea(){
      //   let height = this.textarea.clientHeight;
      //   let scrollHeight = this.textarea.scrollHeight;
      //   this.textarea.scrollTop = scrollHeight - height;
      // },
      // e:SpeechRecognitionEvent
      async recognize(e: any) {
        this.recoredMiniText += `${e.results[e.results.length - 1][0].transcript}\n`;
        if(this.recoredMiniText.includes("cm") || this.recoredMiniText.includes("センチ")){
          this.recoredTexts+=`${e.results[e.results.length - 1][0].transcript}\n`;
          // 正規表現
          this.split_string(e.results[e.results.length - 1][0].transcript.split("."));
          this.recoredMiniText="";
          this.autoScroll();
        }else if(this.recoredMiniText.includes("CM")){
          this.recoredTexts+=`${e.results[e.results.length - 1][0].transcript}\n`.replace("CM", "cm");
          // 正規表現
          this.split_string(e.results[e.results.length - 1][0].transcript.split("."));
          this.recoredMiniText="";
          this.autoScroll();
        }else if(this.recoredMiniText.includes("トップ")){
          this.recognition.stop();
          this.recordBtnValue ="録音開始";
          console.log("you said",this.recoredMiniText)
          this.recoredMiniText="";
        }else{
          console.log(this.recoredMiniText);
        }
      },
      // 小数データへの変換
      split_string(txt_array:Array<string>){
        txt_array.forEach((element,index) =>{
          this.size_text+=element.replace(/[^0-9]/g,"");
          if(index===0){
            this.size_text+=".";
          }
        });
        this.sizes.push(parseFloat(this.size_text));
        this.size_text="";
      },
      //　計測中のサイズ、テキストデータをリセット
      reset_data(){
        this.size_text="";
        this.sizes=[];
        this.recoredTexts="";
      },
      record() {
        this.created();
        if (this.recognizing) {
          this.recognition.stop();
          this.recordBtnValue = "録音開始";
        } else {
          this.recognition.start();
          this.recordBtnValue = "停止";
        }
        this.recognizing = !this.recognizing;
      },
      Trans0to1(){
        this.Step1on = true;
        this.DeleteItem = true;
      },
      Trans1to2(){
        this.Step2on = true;
        this.Step1on = false;
      },
      Trans2to3(){
        this.Step3on = true;
        this.Step2on = false;
      },
      Trans3to4(){
        this.Step4on = true;
        this.Step3on = false;
      },
      Prev2to1(){
        this.Step2on = false;
        this.Step1on = true;
      },
      Prev3to2(){
        this.Step3on = false;
        this.Step2on = true;
      },
      Prev4to3(){
        this.Step4on = false;
        this.Step3on = true;
      },
      // 日付を更新する
      update_day(){
        var date = new Date();
        this.updata = date.getFullYear()
          + '/' + ('0' + (date.getMonth() + 1)).slice(-2)
          + '/' + ('0' + date.getDate()).slice(-2)
          + ' ' + ('0' + date.getHours()).slice(-2)
          + ':' + ('0' + date.getMinutes()).slice(-2)
        console.log(this.updata); 
      },
      DeletePopup(change:boolean){
        // データの更新を行うのであれば、if文を実行
        if(change){
          try{
            console.log("value changed");
            this.size_avg=this.sizes.reduce((a,b)=>{
              return a+b;
            });
            var size_avg_test=this.sizes.length;
            // 計算ができなかったら例外を発生させる
            if(isNaN(size_avg_test)){
              throw "データが正しく入力されませんでした。"
            }else{
              this.size_avg/=this.sizes.length;
              // 日付更新はここで
              this.update_day();
              console.log(this.size_avg);
            }
          }catch{
            alert!("データの変更に失敗しました。\nもう一度入力してください");
            return
          }
        }
        this.Step1on = false;
        this.Step2on = false;
        this.Step3on = false;
        this.Step4on = false;
        this.DeleteItem = false;
        this.reset_data();
      },
    },
  });
